import React from 'react';
import appStyles from '../../App.module.css';
import styles from './About.module.css';
import profile from '../../assets/profile.jpeg';

const About = () => (
  <section id="about" className={appStyles.sectionWrapper}>
    <div className={styles.profileContainer}>
      <img src={profile} alt="Nidhi Patel" className={styles.profileImg} />
    </div>
    <div className={styles.intro}>
      <h1>Hi, I'm <span className={styles.highlight}>Nidhi Patel</span></h1>
      <h2>Software Engineer</h2>
      <p>
        Motivated and detail-oriented software engineer with hands-on experience in software testing and front-end development. Passionate about space technology and systems engineering. Eager to contribute to data-driven, mission-critical projects and collaborate with multidisciplinary teams to develop scalable technical solutions.
      </p>
      <div className={styles.contactInfo}>
        <span>Ontario, Canada</span> | 
        <a href="mailto:nidhi2910patel@gmail.com">nidhi2910patel@gmail.com</a> | 
        <a href="https://www.linkedin.com/in/patelnidhi29/" target="_blank" rel="noopener noreferrer">LinkedIn</a>
      </div>
    </div>
  </section>
);

export default About;
